import React, { useState, useEffect } from "react";
import Navigation from '../components/Navigation';
import Réseaux from '../components/Réseaux';
import TexteAccueil from '../components/TexteAccueil';
import Scroll from '../components/Scroll';
import Logo from '../components/Logo';
import Décompte from '../components/Décompte';
//import "../style/pages/_accueil.scss";
import date from '../date.json';

const Accueil = () => {

    const Date =useState();
    const url = "http://localhost:3000/date";

    useEffect(() => {
      fetch(url)
        .then((res) => res.json())
        .then( out => 
          console.log('checkout', out));
    }, []);

    return (
    <div>
        <div className="home">
            <Navigation/>
            <Logo/> 
            <Réseaux/>
            <div className="home-main">
                <div className="main-content">
                    <h1> ECE POKER </h1>
                    <h2><TexteAccueil/></h2>
                </div>
            </div>
            <Décompte date={out.date}/>
            <Scroll right={"/presentation"} />
        </div>
    </div>
    );
};

export default Accueil;
